wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.450601, 20.5699273], "352 Zakroczym", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKuQ-NptANc9yLL7_UJbe0h5ajGCH1l7bq-dr9kSWtCQJWHrG7355q0ZKbM5kQm66nY33apDJ-Gs9Pe67h0UtK8Gga88p2ITiOIJKFloCWhTyegkcaIQp5YLCBU6wZxB_rcwSrMVGm6At6j8lahiKckfVBdRmDborJTxgL8-A7uEyZTd1Bf57k6vbNdPcz_9-45lFV4Y-Ud8_g?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>Fort X Twierdzy Modlin wzniesiony w latach 1912-15 w ramach rozbudowy twierdzy. Fort został zbudowany we wsi Henrysin dla zabezpieczenia zachodniego odcinka twierdzy. Obecnie znajduje się na terenie prywatnym , właściciel umożliwia zwiedzanie fortu. (??)"));
