wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.4116217, 20.6919679], "Fort Ordona", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKu2DxYHeafP9VI3mjdvWnwQNccM8P14n9Z9WgeEmnNo88XMMVWeSubI5Zsm1KJJ9Mc9-HPJQPeiyBOeBkvB_23N0-NN5SktLrFX4rbrKw_Fkl7xHYC2M6xFM0AxsSWlE85sWjWmaNiN8PJ0cK78QTV2YNQjwjvThS3nHRXI6bALAaWSWpbiY18yFrBsVHJwFHzujRRZ0WsbQw?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>Wycieczki?? <br><br> Fort ziemno-betonowy typu magazynowego, bez tuneli z zachowanymi wszystkimi oryginalnymi drzwiami pancernymi , kratami w oknach i pomieszczeniach , obiekt czysty i nie zdewastowany."));
wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.4182443, 20.7868734], "360 Janówek II", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKvu6wyR9wFjxFV3FX_Ii90c1u9qSsXYcYCBFjaUJkVX3M3mEA08aDbASzZHpTW7likJlMPGJx3zlKmBe9aSHzxn2TKxvOt7a3_Yplb9HILuVpXISHvsSb3OOuIgI-pQyFz3VreSPRcBf2u2hAWf4K6b3gkAlb_CFTAwjlIG8QdG6-u_zVS9gxs5KHejaJ27g0oJwJMiXNKXUA?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>Dzieło D-10 Twierdzy Modlin. Obiekt całkowicie wysadzony i zniszczony. Zachowała się tylko jedna kazamata."));
