wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.10126, 21.3322900000001], "Niemieckie schrony z 1944", "Otaczają Warszawę od wschodu, od jez. Zegrzynskiego, przez Marki, Wesołą, Wiązowną, Pogorzel i do Wisły.<br>Opis obiektu	Z planowanych kilkudziesięciu schronów zbudowano kilkanaście. Trzy rodzaje o odporności B neu - Regelbau 120a (5 sztuk), 501 (1) i 514 (12). Wybudowano je w latach 1940-41, potem pracę przerwano w związku z atakiem na ZSRR. Bunkry zostały jednak wykorzystane w roku 1944. W większości schrony są wysadzone i pozbawione pancerzy, prawie całe zachowały się dwa w okolicach Pogorzeli Warszawskiej koło Otwocka.<br>Opis dojazdu	Linia obrony P.W. zaczyna sie koło Ryni, wypukłym łukiem prowadzi do Beniaminowa (niedaleko fortu rosyjskiego), od południa omija Wólkę Radzymińską, Sieraków i Słupno, dalej między Strugą a Nadmą, wschodnim skrajem Zielonki, przez Wesołą, Zakręt, Wiązowną, Wólkę Mlądzką, Świerk, Pogorzel do wzgórza 116, Łukowiec, Ostrowiec do Wisły. Pokrywa się mniej więcej z linią niemiecką z 1915 roku i polską z 1920."));
wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.1711944444444, 20.9847333333333], "Fort VII \"Zbarż\"", "Fort VII \"Zbarż\". Jednowałowy, otoczony fosą fort zbudowano na planie pięcioboku. W ramach likwidacji twierdzy po 1909 roku fort został częściowo rozebrany. W czasie jednej z modernizacji wzniesiono jedną z niewielu w Warszawie betonową kaponierę przeciwskarpową, której potężne ruiny istnieją do dziś. Zachowały się także koszary szyjowe. Budynki wojskowe istniały na tym terenie do 1999 roku. W okresie późniejszym nastąpiło zalanie terenu fortu, co doprowadziło ceglane koszary do ruiny.<br><br><br>Opis dojazdu	Obiekt znajduje się na wschód od ul. J. Gordona Bennetta."));
wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.1959166666667, 20.9154722222222], "Fort V \"Włochy\"", "rt V \"Włochy\". Zbudowany został jako dwuwałowy fort o narysie pięcioboku z dwoma czołami (przy czym kąt styku czół jest tutaj wyjątkowo bliski 180°). U styku czół oraz czół i barków wzniesiono kaponiery osłaniające otaczającą fort suchą fosę. Głównym obiektem zaplecza były zachowane do dnia dzisiejszego w bardzo dobrym stanie koszary szyjowe. W ramach modernizacji twierdzy fort został przebudowany: powstał jeden wał główny o bardzo szerokim przedpiersiu (około 30 m). W tym samym czasie zastąpiono ceglane kaponiery betonowymi; w szyi fortu powstała wtedy osłonięta ziemnym dziełem potężna kaponiera szyjowa. Po 1909 roku, w ramach likwidacji twierdzy wszystkie kaponiery wysadzono. <br><br>Opis dojazdu	Z ul. Kleszczowej skręcamy w ul. Dojazdową prowadzącą do fortu. Budynkiem koszar opiekuje się Fundacja Ochrony Zabytków Techniki Wojskowej, będąca w trakcie tworzenia tam skansenu sprzętu militarnego."));
wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.2470644, 20.8943394], "Fort Blizne", "Fort III \"Blizne\". Umocnienie wybudowano na planie pięcioboku z rawelinem osłaniającym kaponierę czołową - jest to dobrze widoczne na fotografii satelitarnej. Fort posiadał ceglane koszary. Otoczony był mokrą fosą, mimo to posiadał wykonane z betonu kaponiery. W czasie likwidacji twierdzy po 1909 roku kaponiery zostały wysadzone - ich ruiny można oglądać do dzisiaj. W centralnej części fortu, na osi głównej poterny znajduje się ponadto betonowy schron przeciwlotniczy z okresu późniejszego.<br><br>Opis dojazdu	Obiekt znajduje się na obszarze ograniczonym z trzech stron ulicami: Kocjana, Lazurową i Narwik oraz od zachodu zabudowaniami osiedla Groty. Jest w rękach prywatnych , ale przez bramę widać zabudowania fortu. Można zobaczyć fosę wzdłuż której biegnie gruntowa droga."));
wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [51.94112, 20.2679000000001], "Schrony Kamion", "1.Dwa typy obiektów betonowych: 3 tobruki (?) i 2 inne, nie wiem co to za typ, wszystkie w dobrym stanie, lecz niemal niewidoczne (zasypane), jeden zalany wodą<br>2.betonowy, prawdopodobnie dla działa, zamurowany mocno zarośnięty krzakami, uważać trzeba aby nie spaść ze stropu nad wejściem.<br><br>3.betonowy, schron bierny z dobudowanym Ringstandem, wyjście awaryjne poprzez półokrągły szyb głęboki na ok. 3 m, wewnątrz 2 x drzwi pancerne, 2x mały przedsionek, 1 duże pomieszczenie, żadnych innych otworów typu strzelnicy (identyczne są po drugiej stronie szosy, na plantacjach) można wejść do wewnątrz, ostrożnie na stropie, bo szyb jest przykryty byle czym i można wpaść <br><br> <br>Opis dojazdu	1.Drogą ze Skierniewic do Kamionu (kierunek Warszawa-Żyrardów), po lewej stronie, przed skrzyżowaniem z drogą do Samic. Wszystkie położone są na prywatnych terenach: plantacje pomidorów, fasolki i porzeczek, można wejść za zgodą właściciela.<br>2.po prawej stronie drogi ze Skierniewic do Kamionu, przed skrzyżowaniem do Samic. Schron tuż przy głównej drodze Warszawa-Żyrardów, należy skęcić w prawo (jadšc od Skierniewic) w drogę gruntową wiodącą do pierwszych widocznych zabudowań<br><br>3.Drogą ze Skierniewic do Kamionu, skręcić w prawo w drogę gruntową w kierunku pierwszych widocznych zabudowań, po ok.400m będzie pierwszy dom po prawej, tuz za"));
