wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.2922462, 21.0045292], "Opuszczone domEXPO Warszawa??", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKsBXT-f9dXivFVbOs_KAP6jRJMb0ZYLhFZRtDrWnR8Nn1oeq9rkikXYVGl96i4EUGM6jsVcfSV9asmCGqqUDqDE6uF18LGrOyeJXSk0ztDysV2TPHRomuU-tG7QkzFnf8H2QdGTl2qyHfdFCEWsJwCrxqqkF_LBr8UxuAf1SLjXQ8DkQok19kRWqTpkz1E-z0N7oj1s9Zjp99Y?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>"));
wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [51.9729, 20.7479000000001], "Ruiny dworu Mińskich", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKu0NEjjxn0F_waJA77FuzOKFFO1QNVskC1KWwm5o7_n6SeBVJZWK4EdJHdhU0h8t81AR1WDnATFFog86IidFFOjaxfu_diIldv3z3dqF4NgECvo_zf6VykE7HJq_l7g3CuVIwGeTUbYrtCwxvICjCYPWtv0B7BTY0imvJadtiuM5F1_gQmLrELbOqu4Yl3GO-f9lG_tUhVQVA?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>Dwór zbudowany w końcu XIX w. dla Stanisława Mińskiego, gruntownie przebudowany w latach 20.-30. XX w. z inicjatywy Zygmunta Mińskiego. - Od 1819 roku należy do rodziny Krysińskich, od 1892 do Mińskich.<br>Opis<br>Budynek klasycystyczny, wzniesiony na planie wydłużonego prostokąta, murowany z cegły, na kamiennej podmurówce, otynkowany, parterowy, podpiwniczony, z mieszkalnym poddaszem, później nadbudowany od strony ogrodu. Składa się z sześcioosiowej części starszej, poprzedzonej portykiem złożonym z dwóch par kolumn toskańskich podtrzymujących trójkątny szczyt oraz z części nowszej, otoczonej od frontu i z boku toskańską kolumnadą. Układ wnętrz dwutraktowy z sienią od frontu i z salonem od ogrodu. Pod portykiem we wnęce malowany wizerunek Matki Bożej Częstochowskiej oraz dewiza wymalowana na ścianie: \"Jeżeli domu Bóg sam nie zbuduje / daremne nad nim rzemieślnik pracuje\". Dach czterospadowy, kryty blachą."));
wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.6806, 20.2547999999999], "Dwór rodziny Wołoskich", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKv_VUqDzr3pg_Hc-kxWnjighHt42b2IJ6k98R4jCVIiUoZhpB0mPCdjZ9SooDvPQneUPa25pjbDTmGNcLGFgrV1fuW-f0NtxM8Q_V0n5ip3fO0SaKABY3L29ZDHfVz2oKY87Z7CfTK2t-FbKkJCAaA4UalN8B8KX5ueLUinJMjtHlb0ZHKnqaR52t3sJx3Rs_WvlNbE8_tiDw?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>Obecnie dwór jest nie zamieszkały i niezagospodarowany. Pozostaje w bardzo złym stanie technicznym. <br><br>Dwór został wybudowany w I połowie XIX wieku. W roku 1783 majątek należał do rodziny Wołoskich (Wołowskich ?). W roku 1909 właścicielem majątku był już Alfons Młodzianowski. Pod koniec lat 20 tych XX wieku posiadłością władał już Beniamin Barciński. Całość majątku wynosiła wówczas 319 hektarów."));
wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.3931, 22.3117999999999], "Dwór (do sprawdzenia)", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKvYnjvUFs1cETdTWZvm5nCjoi6Uwy9wrWohJ09TbgmkIWOU_kCqeMDUNssKeJTNTBwU-Oj3MK-nJaXuTRi-FQQqOGaae7JELETdFM_0R31suddAcLoQ91b8NsCJ2WdH1HuAIzUFmG3vltcjg9g8TlDLgbqhWuuXnEaAsn57RAGzm4zTKmxakyrOUkMLtJQJSn4SY2amAQprtw?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>Częściowo pozostaje zamieszkały. W trakcie odbudowy."));
wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [51.9521768, 20.5493017], "Dwór szlachty", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKvAQkJO9YEpiHCrEvF9-sg85zQCoJvSVgenO18ywXVxAUrlCnsLxF6HhRoSbTt276kO4dixrTc737pGwqSUtifODLlMxZpRdzlmVRwT1dvwXIMBR54pC637b_ekIOVGd2iIWdQMCzk6EH_j9p5FVrcw1zO6a73Pn1w6YDhh2S-W5GBeXDqLZxF9c_CXI886s8L7NNirn-Yl5Q?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>chujowy już<br><br>Stan obecny<br>Opuszczony.<br>Historia<br>Dwór został wybudowany w ostatniej ćw. XIX w. W XVIII w. miejscowe dobra należały do licznej drobnej szlachty. W roku 1909 posiadłość należała już do Edmunda Urbanowskiego. Pod koniec lat 20 tych XX w. majątkiem gospodarował J. Tomawski. Majątek liczył wówczas 223 hektary.<br>Opis<br>Dwór murowany z cegły i otynkowany, posadowiony na planie prostokąta o regularnej bryle, z dwuosiową przybudówką przy elewacji bocznej. Parterowy, z mieszkalnym poddaszem nakrytym dachem dwuspadowym o połaciach krytych wtórną papą. W połaciach lukarny z trójkątnymi szczytami nakryte daszkami dwuspadowymi. Elewacja frontowa 7 osiowa z dwuosiową przybudówką po lewej stronie, z niesymetrycznie rozmieszczonymi osiami okiennymi oraz drewnianą, przeszkloną werandą poprzedzającą wejście główne na 3 osi od prawej strony. Wystrój architektoniczny ograniczony do naczółków nadokiennych w formie odcinka łuku, profilowanego gzymsu nadokiennego oraz płaskich lizen narożnych. Całość skomponowana w duchu klasycyzmu. W<br>Park<br>Zdewastowany i zdziczały park z około 1850 r.<br>Inne<br>Spichlerz z około 1850 r."));
wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [51.7582, 20.723], "Dwór Bielany", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKtEzc_cZ1ri23G5EkLP_En5wWHG6UxfimBhKv_nb6NzIeU5azLINJ5RElFDgzRo9P3C_wSdv0Gh_jxEiuAyXAa6Tugh5eHr8HZCBBKCcIP70tA88lHxdGE1EQ3yV9nw253ZQw8oheweQhpVgVQJ8oybdaS4Bx4-pnbZ-fzINQ0smzhzXe0sn2ped8sH-GIeiiQj9MNMD5Xteg?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>Stan obecny<br>Opuszczony. Park zdziczały.Obiekt niedostępny, niewidoczny z większej odległości.<br>Historia<br>Dwór został wybudowany lub na nowo ukształtowany w latach 30 tych XX wieku. Inicjatorem tej budowy była Władysława z Jagminów Reynelowa od 1936 roku Aleksandrowa Woytkiewiczowa. Majątek w jej posiadanie przeszedł od Jadwigi Antoniny Marii Antoszewskiej. Do skrzyńskich miejscowy majątek należał od 1873 roku. Po zakończeniu II Wojny Światowej dwór wykorzystywany był przez pracowników miejscowego gospodarstwa rolnego. W roku 1980 dwór został gruntownie przebudowany, dodano wtedy jedno piętro i pozbawiono zabytek wszystkich cech stylowych. W latach 90 tych budynek był użytkowany przez Państwowe Gospodarstwo Ogrodnicze.<br>Opis<br>Dwór murowany z cegły i otynkowany, posadowiony na planie prostokąta, wysoko podpiwniczony, piętrowy, pierwotnie parterowy. Na elewacji frontowej umieszczono otwarty taras. Na elewacji ogrodowej 4 kolumnowy, półokrągły portyk, dźwigający taras na wysokośc drugiej kondygnacji. Otwory drzwiowe pod tarasem zamknięte półkoliście. Całość obecnie bez wystroju architektonicznego, pozbawiona cech stylowych. Pierwotnie dwór był skomponowany w stylu dworkowym z elementami baroku oraz klasycyzmu.<br>Park<br>Pozostałości po parku krajobrazowym.<br>Inne<br>W otoczeniu dworu zachowały się zabudowania gospodarcze oraz dom administratora. Obecnie tak jak dwór gruntownie przekształcone."));
wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.9542, 20.9911], "Dwór do sprawdzenia", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKuZmgqLZ6yBB_UHc5ap2FauUNXvdKaxNowuX6vUyP0XSG7zmrjx-D1P5CNP8muQ8_XVQRgHqraeLqqDMBz5SIaBq2uvA-mCVhxFfp-aUhrYdQXoCo5uwkFqgEhlgapq7fgzSmPqVjge__oYi5b_bQV_OJoYJZ8f23vvYDN6DXrgJ40uErdZThF8P7hcRes2Kp_fekyTsNZT_g?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>w 2015 Stan mieszkalny, obiekt wystawiony na sprzedaż. Nie wiadomo jak dzisiaj"));
wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.9607, 20.1937], "Dwór z końca XIX w.", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKtJLUz99O6dC6jUTM5jayX6-RpeOLHLCJoXOyORLJrK7-WzwXznUP353J0AVdcBqqvpq3vFGLcY0lyf2hYIE5vacmAQA3ohE95QP0rsHunIq9bPaTFoKvIPl4VMzWmTsGU_px1Rg7jia5EJz8lQvIFwFAbwchB1u5CI13UJfW7WwicCQ4IKYBZlOeWW6aivOYM-4TCdKHj1kQ?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>"));
wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [51.3180964, 20.6891808], "Zespół pałacowo-parkowy w Borkowicach", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKuqAMioWkC1jJmUX_Gb9zd5FqVR14zbH0EoDhc-ZDQhOy2FqFy83rZiN73SGIoX_2xQ7F8SQNs6GAO08nNTs2aXlSBEXdHueK1FIoA58GevZvu6NL_CjOKN3Dav7aUWgMhnyjC4W1ZoKjf7XppAM6dPnytnAhl0D-RzmFAdlfjjqEDN_RkhzVz0ezOLKhmxHBL9Hegqbs4ZRg?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>hgw czy można wliść"));
wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.3197, 20.2623], "Dwór Brochów", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKsT3IsYU_24Vy6acE6yi6MfsjnHYjEUwj5t3sDgu1GeSG6O0d_suJAi4_G-OrThPV28DuDpzhdAt_awEEakNsvUqrW7KVoatkbonIoVoWllyYIlOD5ZT-PyiVVrGLUZf9EiVBfrrgGE49aQm_n_bUl8z3Vnqvc9nk1upcCejYq1d_PuAgMSF7Evs_hG6NSXl-H1ZdIr215EhA?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>Opuszczony.<br>Historia<br>Dwór powstał w 1820 roku dla Jana Nepomucena Lasockiego i jego żony Heleny. W latach 1886-90 dwór zostaje rozbudowany przez właściciela. Budynek został uszkodzony podczas I Wojny Światowej jednak to lata po 1945 roku przyniosły zabytkowi ostateczną destrukcję. Wtedy zamieszkali w nim okoliczni chłopi doprowadzając obiekt do rozpadu. Pod koniec lat 80 tych XX wieku zaczęto rekonstruować budynek według planów Bieleckiego i Heymera, nawiązując przy tym do wyglądu z początku XIX wieku.<br>Opis<br>Budynek na planie prostokąta, parterowy, podpiwniczony, murowany z cegły, otynkowany, przekryty czterospadowym dachem z blachy, z oknami połaciowymi w formie wolich oczu oraz lukarn. Elewacja frontowa wyposażona w ryzalit środkowy w formie zabudowanego ganka, zwieńczonego trójkątną ścianą szczytową i dwuspadowym dachem. Skromna klasycystyczna dekoracja w kształcie gzymsów nadokiennych oraz boniowania narożnego. Elewacje urozmaicone żeliwnymi balkonami. Regularna bryła dworu została zakłócona poprzez dostawienie z lewej strony poprzecznego pawilonu."));
wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.1424, 20.7117000000001], "Pałac z 1936", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKtdAd0IOpgBZ_2YApS0TVuX6EUmd1Mv7Qa29aRONrret6NTaspeOuuZYzCU1d2s8poP6NB8kQxv5d_5GOcapbxqesJK1AQL4SbsL_HvcchmyEkXqFEHMz7-Y0FsUrvSQtUnYlcPJ687uMi4mz8_zKHt6xJj1Dw_GaECwFn6HElmZQh5Gan03_wBn11HE17RKUaQKDDXjBQ_tg?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>Pałac został wybudowany w 1936 roku. Do rozpoczęcia II Wojny Światowej właścicielem majątku był K. Kowalski. W roku 1940 pałac przeszedł w posiadanie Zarządu Majątków Ziemskich. Między rokiem 1942 a 1945 w pałacu ulokowano szpital. Po zakończeniu działań wojennych w majątek został przejęty przez Szkołę Główną Gospodarstwa Wiejskiego."));
wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.9028, 21.5998], "Pałac z 1900", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKvPh2VSr32xmvYojZJv5wPU5wXTUvgKLrfpGzKGpQB_BQiffMcQ1OI_bRar1lfz5JM1R_49mYP625jHm4tKiGIe70wajdrwVOb3J6EFp5F4dGehVOjg6E40M44D6krHd-VwXiPz4xF2DMWbaVhp8z-g9JYOwUt_6ku3dDd-MPCl8HW1g4YohS71OUS2cyX9ScYFoMLEljhSdQ?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>Historia<br>Pałac powstał około 1900 roku na zlecenie ówczesnego właściciela Macieja Marchwickiego. Projekt sporządził znany warszawski architekt Leandro Marconi. Pierwsza odnotowana wzmianka o wsi pochodzi z XV wieku. W ręce inicjatorów budowy pałacu dostała się w roku 1848. W posiadaniu tej rodziny majątek pozostawał aż do 1945 roku.<br>Pałac powstał w okresie nawiązań do twórczości doby stanisławowskiej. Poprzez takie odwoływania starano się przypomnieć okres schyłku niepodległej Rzeczpospolitej i ducha ówczesnej sztuki. Tu mamy bezpośrednie nawiązania do architektury pałacu natolińskiego jak i pałacu Na Wyspie w Łazienkach w postaci pękatych balkoników rokokowych w elewacji frontowej i ogrodowej. Motywy te były powtarzane przez Leandra Marconiego również w innych obiektach.<br>Opis<br>Budowla klasycystyczna, stylem nawiązująca do architektury doby stanisławowskiej. Wzorem projektu stał się pałac na warszawskim Natolinie. Na planie prostokąta, z siedmioosiową elewacją urozmaiconą czterokolumnowym, korynckim portykiem, dźwigającym belkowanie, gzyms koronujący oraz attykę. Portyk na planie elipsy. Po stronie ogrodu trójboczny ryzalit zamykający salon. Elewacje boczne urozmaicone parterowymi przybudówkami. Wnętrza o układzie dwutraktowym z hallem i salonem na osi. Wystrój wnętrz to klasycystyczne sztukaterie i stolarka. W salonie neorenesansowy strop belkowany. Pałac cieszy się niezwykłą starannością wykończenia kojarzoną z twórczością architekta."));
wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.5345589, 21.7723126], "*Dwór MASONÓW z TAJEMNYM KORYTARZEM", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKs8brMu32SRnXpc4HnA16MFn2utTfs2iwO7rehqP0w-PAkrF1JRdBi782hyECg1zKmwuebDO2H_SRf2ZI-TvThNdVhpAxoROabjIa443WoHL4Mxn9TSdS_DVv7EDbx83VlVRy7HJ0U50yuheX9q56kmYcRTS1wzjAWTMSLg-fI5wXlqmuJh54iEtfqo-tFLCwBeFtcQlLvWRQ?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>niedostępny chyba https://dworekbaczki.pl/<br><br>Dwór rodziny Starzeńskich (inne źródła podają rodzinę Rozwadowskich) z połowy XVIII wieku. Dwór do dnia dzisiejszego zmienił wielu właścicieli. W latach 80- tych XX wieku oraz przed II Wojną Światową pełnił rolę pensjonatu domowego. Przed dworem murowany, XVII wieczny lamus. Legenda głosi, że po \"potopie\", w czasie prześladowań religijnych mieściła się w nim tajna kaplica ariańska, później loża masońska. Lamus z dworem miał być połączony tajemnym korytarzem, do którego wejście do dziś pozostaje zagadką. Dowodem jego istnienia jest pas ziemi, na którym nie rosną drzewa a krety nie robią kopców. Śladem obecności masonów we dworze jest pięcioramienna gwiazda umieszczona na żelaznym wejściu drzwi wejściowych.<br><br><img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKvG2IP0H2-lHQm1Ieu2LyVB0zpeurgJhgiPlXMXTCbp_4-RDa9X-JkfoMOLmesgPmjqMtuRiHRrC4hMGFvkEtYD-idGdQCPH00xd68cBYzj9IEtOYkG71zpZpoWHlbJa0VLR7As8i70Et_yWwSzhlkkf_zaVv6q5DglvfzzAmwktvGM1kxdOr_Ctzt6cPRIb2FpKWmRB18w3w?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br><img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKtOB7xCkpOdmcBvwT4Y9rSEgJaPILUIz9gGy81tX8V6JiyCGEg4u2OdQ4cDSel1rF8zZVeec4IwaYeD6s2OklvKV9f9ZA1aPrXO4FvOKNpUmPP3BL0pt4gNvuwCr4POssPxI8B5t29S1vsvL8kaCE0HNB1aN_k17-f2au5TSyYgzLUDKxRoNnd8qrCqjueuSp8p7Wq1FaOhEw?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" />"));
wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [51.8763, 21.0608999999999], "Dwór do spr", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKso6zqQ5JScPZclIOD2zgh_Ph2-WF99CPvcKARmGwPS4KyZyqFrnU_0TM0NkvwJPXlQJrLK1i4nWV2awJaAbFSZNPFh7DAzq_THMNEPQdTzz-U4qlg7QPzEz06-N1jJ0ZOoC4nvdAx6_hoyUjN6ZvdxBO4P8-HKY_JVFDf6Ep64E3Slz7ophNVmUMfHFjywM7iTjXqHLeJ0cg?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>Dwór w remoncie (2008).<br><br><br><br>Ostatni dwór  na \"B\". Dodawać dalej na \"C\"<br>http://www.polskiezabytki.pl/m/search/?t1=&t2=&t3=&w=7&q=&p=&all=1"));
wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.1941402, 22.7748568], "Dwór z 1830 do spr", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKtq_o00r70m32DcG6lO43O4idxwML_MjEoIM5mZ08WaK7DmZVXrfbgtNWVH6lThyZ92xwulh_Fn61PVKUHm7t9B3Uu0jZWmHrK0sfeVwso6iQT9hDDoIkjZmKCLvAcf02ifR5ljzOapGje1NOPbaz0s-ZW29acbkhC7spiXclE9TdY577aXd4Mv08Jk0nrjDkFl7TbKVsiGUg?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>Dwór został wybudowany około 1830 roku dla rodziny Wężyków. Pod koniec XIX wieku został przebudowany najprawdopodobniej na polecenie nowych właścicieli Węglińskich. W XVI wieku miejscowy majątek był własnością Kiszków, potem należał do Zabrzezińskich i Iliniczów. Na początku XIX wieku majątek przeszedł w posiadanie Wężyków między innymi Ignacego Wężyka. Pod koniec XIX wieku majątek nabyli Węglińscy. Pod koniec lat 20 tych XX wieku właścicielką majątku liczącego 600 hektarów była Maria Węglińska. Ostatnim właścicielem majątku był drugi mąż Marii Władysław Jasiński. Obecnie dwór stanowi własność prywatną. Obiekt w stanie ruiny ale w trakcie odbudowy. W otoczeniu part w przyzwoitym stanie.<br>Opis<br>Dwór murowany z cegły i otynkowany, posadowiony na planie prostokąta, o regularnej bryle, parterowy, podpiwniczony, z mieszkalnym poddaszem nakrytym dachem dwuspadowym. Pod koniec XIX wieku w wyniku przebudowy trójosiowe ryzality umieszczone na elewacjach wzdłużnych korpusu zostały nadbudowane i zwieńczone wysokimi trójkątnymi, ceglanymi szczytami w układzie schodkowym, dekorowanymi lizenami, ostrołukowymi blendami i sterczynami. Podobnie udekorowane zostały szczyty elewacji bocznych. Elewacja frontowa 9 osiowa z 3 osiowym ryzalitem centralnym z balkonem na wysokości piętra. Wystrój elewacji ograniczony do dekoracji w tynku obecnie słabo czytelny w wyniku degradacji dworu. Całość skomponowana w duchu klasycyzmu i neogotyku w odcieniu północno-wschodnim."));
wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [53.0229, 19.8306], "Dwór Chromakowo", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKuAiirZFQ8CsVvrz4hHuFsUnLG66YqPMFFIxfyXS4IQPb89WoN7IFuc2-bE8eI4_jiqM_oxM7-UZXfMH-veMmDMMNh8Cfrqt-Xg0Y5Z_7AQVYHQTs-IbGaglUTzAtdJbwFK9dKZwFF0un4kHVR3nLENxGsi9hS4mNZgPMe2YHNkYBIHWxIyxDGRqUF6iyy1ti6qK3ic_ussgQ?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>Dwór został wybudowany w latach 80 tych XIX wieku dla rodziny Kreńskich. Pod koniec XVIII wieku miejscowy majątek należał do Kuczborskich. W wieku XIX przeszedł w posiadanie Kreńskich a następnie Mieczkowskich. W 1909 roku majątek został podzielony na dwie własności: Teofil Mieczkowskiego i Zdzisława Pytkowskiego. W latach późniejszych majątek kilkakrotnie zmieniał właścicieli i należał kolejno do: Sokołowskich, Oskierków, Zdziechowskich. Pod koniec lat 20 tych XX wieku posiadłość licząca 336 hektarów należała do Józefa Zdziechowskiego. Jego córka po mężu Budna przekazała majątek w posagu. Taki stan rzeczy utrzymywał się aż do zakończenia II Wojny Światowej. Później majątek przeszedł na skarb państwa a budynek został zasiedlony przez lokatorów komunalnych. Takie użytkowanie doprowadziło obiekt do szybkiej degradacji i obecnie znajduje się on w ruinie choć w dalszym ciągu jest po części zamieszkały. Również tragiczne są losy właścicieli dworu. Maria z Mieczkowskich Gościcka urodzona we dworze w roku 1874 zginęła w Powstaniu Warszawskim w 1944 roku. Stefan Sokołowski (ur. 1891), współwłaściciel Chromakowa, w 1919 roku ochotnik Wojska Polskiego i poseł na sejm 25 kwietnia 1941 w obozie w Auschwitz został zatłuczony na śmierć przez Niemców.<br>Opis<br>Dwór murowany z cegły i otynkowany, posadowiony na planie prostokąta, o regularnej bryle, parterowy, podpiwniczony, z mieszkalnym poddaszem nakrytym dachem naczółkowym. Elewacja frontowa 7 osiowa z 3 osiowym, piętrowym ryzalitem umieszczonym centralnie. Ryzalit z otworami okiennymi i drzwiowymi zamkniętymi półkoliście z balkonem na osi na poziomie piętra, zwieńczony attyką. Wystrój architektoniczny ograniczony do boniowania narożnego, pilastrów rozczłonkowujących elewację ryzalitu. Całość skomponowana w duchu neorenesansu. Zabytek pozostaje w ruinie. Wystrój nieczytelny, konstrukcja silnie naruszona. Parku brak."));
