wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.6600328, 20.3602124], "Drewniany Dworek", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKtWynmOq0I4tHwdGi_LropBhfmzFnVYxR8qYC8LOu5EOTyHCIHIgb8Eki2HBJxlOtD7vbiXbGRvQiiDuMiXjbcdI4n8l2JgAMCRF9djdt8asQW-JjLU5tGuCurTWjd2wFGJUQYWammZaQgDa4CMeXRol1-Fb3VlKOid3D2jho6HQnOyZJgjVg3zeRBkYs1XRTHS1rBoc3uVgw?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>https://www.facebook.com/media/set/?set=a.4368340503210664&type=3<br><br>Dwór powstał na przełomie XIX i XX wieku. Pod koniec lat 20 tych XX wieku właścicielem miejscowego majątku pozostawał Jerzy Marczewski a jego ziemia liczyła 229 hektarów. Taki stan rzeczy utrzymywał się aż do zakończenia II Wojny Światowej i przejęcia majątku przez skarb państwa. Obecnie dom stoi niezagospodarowany, opuszczony i w bardzo złym stanie technicznym. W okolicy mały, zdziczały park."));
wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.7933, 21.0731000000001], "Dwór Dzierżanowo", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKvc3UKO2pQsrpnA5q1mjzPf6Z2sftzTMC0oA2sOt62EYNfm35Ra5sSnvnAzlqcdm9EKYZKEH51c_e8-Fb1FOkPs87nbSzNKxLrUWElLzwiZ9AD4GXdK79XVc6nUKMl_ZCS3kUoXHbOf1SMNPInaat2UPqUr3kV-ok4kXv14fJsIRbM7byDcjLA7eEVdccQAmZ_DBtUwqxzKMw?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>Stan obecny<br>Dom w stanie zabezpieczonej ruiny. Parku brak. Obiekt dostępny z zewnątrz.<br>Historia<br>Dwór został wybudowany pod koniec XIX wieku. W roku 1783 miejscowy majątek podzielony był między trzech właścicieli: Dzierżanowskich, Chełchowskich a także Laskowskich. W 1909 roku właścicielem by już tylko Jan Majkowski. Pod koniec lat 20 tych majątek był w posiadaniu Władysława Radziłowskiego i liczył 67 hektarów. Obecnie dwór jest opuszczony i niezagospodarowany. Pozostaje w stanie zabezpieczonej ruiny. W okolicy bark parku."));
