wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.0817318, 20.1707247], "Schrony?", "Obiekty o odporności C lub B1 około 7 (tyle znaleźliśmy)+ po dwa tobruki do każdego. Obiekty bez pancerzy, zamurowane w latach 50/60 (środki chemiczne??) Obiekty powstały prawdopodobnie w latach 43-44. Nie posiadam danych na temat obiektów.<br>Opis dojazdu	Z Bolimowa skręcamy na Jasionną wzdłuż lewego brzegu rzeki Rawki, po około 4,5km skręcamy w prawo w drogę asfaltową. Schrony znajdują się po prawej stronie drogi w polu dobrze widoczne 4 schrony. Po przejechaniu przejazdu kolejowego linii Warszawa - Poznań 3 schrony . Jeden przy samej drodze na terenie prywatnym (gospodarstwo)."));
