wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.0697694444444, 21.3783722222222], "Niemieckie schrony z 1944", "Opis obiektu	Schron bojowy (wybudowany w latach 1940-44) - jest to ciężki schron typu MG-KASEMATTE o wymiarach 9 x 10 m, grubość żelbetonowych ścian i stropu wzmocnionego stalowymi belkami wynosi 2 m. Wyposażenie składało się z filtru powietrza (uruchamianego ręcznie), peryskopu umieszczonego w stropie, piecyka węglowego i sześciu prycz dla załogi. Schron posiadał dwie strzelnice osłonięte pancernymi płytami stalowymi. Pierwsza z nich grubości 25 mm osłaniała strzelnicę obrony wejścia. Druga płyta została wmontowana w ścianie kazamaty bojowej. Jest to płyta typu 78P9, grubości 200 mm, wadze 18 ton i wymiarach 3,8 x 3 m. Od strony wewnętrznej do płyty dostawione było jarzmo kuliste, w którym znajdowała się lufa środka ogniowego. Prawdopodobnie zamontowany tutaj był wielkokalibrowy KM MG-115 lub MG-131. Kąt ostrzału wynosił 60o. Ponadto po bokach otworu ogniowego znajdują się dwa małe otwory, przystosowane do peryskopów, ułatwiających obserwację przedpola. Pomiędzy pomieszczeniami znajdowały się gazoszczelne, stalowe drzwi. Łączność pomiędzy pomieszczeniami utrzymywana była za pośrednictwem rur głosowych. Dodatkowym elementem obronnym (zabezpieczającym przed wtargnięciem nieprzyjaciela do schronu) była krata przeciw szturmowa typu 491P1, składająca się z pięciu 20 mm prętów i ramy. Na zewnątrz, wszystkie fragmenty widoczne schronu pokryte były kamuflażem a całość dodatkowo nakryta siatką maskującą. Załoga schronu składała się z sześciu ludzi. (Inny obiekt w pobliżu)<br>Opis dojazdu	Dojazd do Otwocka drogami nr 17 lub 801. Z Otwocka droga lokalną do Celestynowa. Przed Celestynowem we wsi Dąbrówka należy skręcić w lewo w gruntową ul. Karczewską i dojechać nią przez pola i las do szczytu leśnej wydmy \"Dąbrowieckiej Góry\". Na szczycie niemieckie bunkry z II wojny światowej."));
