wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [50.6759633607377, 16.6044187545776], "opuszczony dom", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKsb2-W45BnADt5CNG3PcLSjFE2embYp4DJWwwx17BPVWYXkcs_u6rVIeYup0WePV97KPvxhPSvo_Wt6ft_FoLdTZHl-9VqbjrPY2fQQMqY1vS7CWJyqRjLu-WSLWA2wJUE2ntPU3WSajpH5xQI7cLW7cP7N-1QZa5dH4-d84haH42T0tpK1aWua8JaBcUYTNK6rkF9RdkjHXiA?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>https://polska-org.pl/4513011,foto.html?idEntity=560511<br>Pierwotnie w miejscu dzisiejszego budynku, w 1742 r., jednocześnie z budową domu modlitwy (zboru) bielawskich ewangelików, wybudowano budynek szkoły ewangelickiej. Jednak niewielki, drewniany budynek, okazałał się po latach, zbyt mały dla rosnącej liczby uczniów. Początkowo wynajmowano dodatkowo jedną izbę, w którymś z pobliskich budynków, a w 1838 r. wybudowano obok, nowy budynek szkolny (teraz dom nr 7). Pierwsza szkoła spłonęła 7 kwietnia 1909 r. Niemal natychmiast po pożarze przystąpiono do budowy nowej szkoły, którą otwarto już w połowie 1910 r. Jednak po I WŚ, kiedy spadła ilość uczniów (otwarte zostały szkoły bezwyznaniowe), budynek nr 4 odkupił od gminy ewangelickiej, fabrykant Carl Jakob i przekształcił go w kamienicę czynszową. Po II WŚ pierwotnie był to też dom mieszkalny, po remoncie w latach 70-tych, umieszczono w nim przychodnię zdrowia i aptekę. Po 1998 r. przychodnię zlikwidowano, a budynek sprzedano prywatnemu inwestorowi. Przez kilka lat działała tu jeszcze apteka, jednak i ona się wyprowadziła. Budynek wystawiony na sprzedaż, nie znajdując gospodarza, niszczeje. /SyG/"));
wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.2514027, 20.9815036], "Fabryka Garbarska Temler i Szwede w Warszawie", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKvmoF6Hzjn3uqnN779jz0yY7SOKPT0n0UG1hosK4Zxngu7LmI8pbKfvYRSWgHI5t3weh9Cu-x29sDMwy-wL3x7k3myRMAm_coVeJ-Oj8FjQdUYmSBrlEq5-jeB2zoDWrrWG9FqwpfQTPfwH0BwnBL-nWAqD27RSQZU6syDP8SDzFeM3xSkVwaFzg58Qc1KYDAzQ_Zm9ClZgI7U?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>Budynki dawnej garbarni założonej w 1817 r. przez Niemca Jana Gottfrieda Temlera. W poł. XIX w. firmą zarządzali synowie, zawiązując spółkę z Ludwikiem Szwede. Po wojnie działały różne zakłady, w tym między innymi Miejskie Przedsiębiorstwo Oczyszczania, Stołeczne Zakłady Wyrobów Konfekcyjnych Apis oraz firma obuwnicza Syrena. Obecnie kompleks fabryczny pozostaje opuszczony, a o odzyskanie obiektu starają się potomkowie rodziny Temlerów. W 2010 r. kompleks został wpisany do rejestru zabytków. Zdjęcie zza siatki pokazuje skalę obiektu."));
wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.2364403178044, 20.9898895025253], "kamienica", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKtosClLg51b3A5UvARmelgaE1aKc8gRSU1NJk_-a4o0e8QZUYT4-55QiSd5CqljKIG9Mit_u1sHppvKY-69dtH7yQSQXoLuO5FnPmFAgyC0rWVQ1gd9rUOluaO6SPIW2gH448McGCcgxyLkh5nbONkpLLcLh1OldJ9bClxDRoTUREkeNymURTm1EdQvHMcMRiOgFcLc_nBMJoY?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>Narożna kamienica z oficyną zbudowana na początku XX wieku sumptem Chaima Gerkowicza, wysiedlona, czeka funduszów na rewitalizację<br>Niemalże naprzeciw, pod nr Żelazna 67, 3 marca 2001 r. miał miejsce napad na filię Kredyt Banku, w czasie którego trzej ochroniarze z zimną krwią zamordowali trzy młodziutkie kasjerki. Sprawa była głośna, sprawców szybko ujęto i skazano na dożywocie.<br>Wnętrze opuszczonej kamienicy Chaima Gerkowicza jest do obejrzenia tu:"));
wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.1280545763474, 21.0170624255397], "*Restauracja baszta", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKtyi9eU2XjoyXs-Ev12GDhw4YlkXdfL0Ph5ZjbtsdO_nkmKCGjgXywKW1OiwRJqLGEAIZsdd5WS-vjExe6sWyqKZp8-I7HmsyjpB9GSZmJ35c8fZIjLFPM5HGff2bflEUtJShxtKjmf_13I9B09hotGFKFvZWuhuEkhM9hlSkSHScvFdwnZJezhNLWXNVwZWGvOcFZOUj8IxX8?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>Przedwojenna willa, od 2009 r. zamknięta i opuszczona, przez wiele lat tętniła życiem. Po wojnie, w 1959 r. właściciel wyremontował obiekt i urządził restaurację Baszta. Czytam na warszawskich stronach, że lokal był kultowy, z dobrym jedzeniem i zacnymi gośćmi.<br>Na działce jest główny budynek i pawilon w tej samej stylistyce. Teren jest ogrodzony, Anna robiła zdjęcia ponad płotem i przez pręty."));
