wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [53.8772743, 14.2699414], "Bateria przeciwlotnicza Mielin", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKvjCH_co0LVkDpEzuhctU9_gD8WEKVe4B5cEUxf_K9Y5E92_dAaHusBtbgc1PANa521Dk8ivtHa-JIx2oQd-uQX8VZVHcZ2ZUm6zEXno6xlJtzKgCL5UjLvaM71ngFo-3elnVPs-NOv1UiNrAgCQ8C4SGpThJl_IDNkmMaf1qJRh5jgeXlZCHZW2H9ZLlkojwiDa_a8Jaw6uQ?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>LOKALIZACJA NIEDKOLADNA (geomapa na 2 zdj)<br><br>\"Pierwszego dnia próba odnalezienia baterii przeciwlotniczej na półwyspie Mielińskim zakończyła się fiaskiem. Obszar, na którym znajduje się obiekt jest bardzo gęsto zarośnięty bujną roślinnością ... dodatkowo okazało się, że koordynaty znalezione w sieci były błędne. Wyprawa przypominała przedzieranie się na ślepo przez dżunglę przy pomocy maczety. Na drugi dzień po ponad godzinie poszukiwań udało się trafić na pierwszy element - schron artylerii osłonowej. Nie łatwo było dostrzec obiekt, gdyż porośnięty mchem beton był ledwie widoczny w gęstych zaroślach. Kierując się na południe odnaleźliśmy główny blok koszarowo-bojowy. Satysfakcja po dotarciu na miejsce była ogromna.<br>Bateria została wybudowana w latach 1937-1938. Wszystkie obiekty były dobrze zamaskowane oraz posiadały śluzy hermetyczne na wypadek ataku chemicznego. Uzbrojenie baterii stanowiły 4 działa 105 mm.Jak podają źródła, jest to jedna z najlepiej zachowanych niemieckich przeciwlotniczych baterii w Europie. W żadnej poniemieckiej budowli fortecznej nie widzieliśmy tak wielu tak dobrze zachowanych napisów oraz farb na ścianach. Piękne miejsce\"<br><br><img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKsQLg2LV2Dv1lTTDycFijL6uWxJLbAvrlGVs1WPf_2no27N-PC-K_v1AO3RHJBk4nOXdFB9eoglH-msVrLkDWpFwBSamXEdPaSwCsidjW4NvcPyC28ujrOC6oL4klLxsD68V_5aRIEZboFq7HqygKEnsVasSmKHwVkl6Q3VWu5tNhh583LoZNow3MS5-3mv7ssvd175vscCTQ?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" />"));
