wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.4498419, 20.9780425], "RUINY PGR", "<img src=\"https://mymaps.usercontent.google.com/hostedimage/m/*/3ADbDBKtIB27mWG9vj4aV12QcCvJ0pcTkmHsUg5UFQy_SKrlGf9wyPcqhRamtUP7VnWJgIhbyDcmIaDVuCc4GEi2mkrTq-xM7UCs474r5AkiVz2QwIGvfePi_7G2ISL9oczT-8_tixMAOpyugLpmk6pIp9lZEwiwUFcyjI0gzNwaM33dDpO6jq0CYuixYYPwS7TgdrUmsSDDJTArf0Q?authuser=0&fife=s16383\" height=\"200\" width=\"auto\" /><br><br>byliśmy tu  z tym typkiem co miał pisać książkę o PGRach<br><br>Bardzo ciekawe zdjęcie pozostałości Kombinatu Państwowych Gospodarstw Ogrodniczych (KPGO) Wieliszew, wcześniej PGR Wieliszew, wcześniej \"Bosówka\" i AGRiL a jeszcze wcześniej folwark u Wieliszew. Ostatnim przedwojennym właścicielem folwarku był Szymon vel Simcha Pfeffer, którego Niemcy poszukiwali aby się zgłosił do gminy w Nieporęcie, wywieszając obwieszczenia że jest poszukiwany. Pewnie gdyby się zgłosił byłby to jego koniec. Podobno wyjechał do Izraela. Na zdjęciu zabytkowe obiekty byłej stajni z XIX wieku, spichlerza oraz gorzelni, w której później mieściła się siedziba PGR Wieliszew, zanim zbudowany został nowe obiekt biurowy przy współpracy bratniego narodu radzieckiego, obecna siedziba Gminy Wieliszew.<br>Można też przeczytać więcej informacji wraz ze zdjęciami o folwarku Wieliszew w ostatniej mojej książce \"Ocalić od zapomnienia. Historia zatrzymana w kadrze i na dokumencie\" od strony 331. Jest tam paręnaście stron o historii tego miejsca. Zapraszam do lektury. <br><br>https://www.facebook.com/lotynamotolotni/photos/gm.2710448902510296/1133755786835133/?type=3&theater"));
