wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [52.0028268, 14.7184734], "Nawiedzony dom, gdzie można dostać kubkiem w głowę jak na Szkolnej", "Byłem dzisiaj w Gubinie. Czyli (dla niektórych osób na naszej grupie) na krańcach naszego pięknego kraju. Czy może być miejsce bardziej krańcowe? Oczywiście. To wieś Budoradz. 😄<br>A było to tak: Pod \"Biedrą\" usłyszałem kłótnie kilku budowlańców ze swoim szefem. Zagrozili, że jak znów dostana polecenie remontowania tego starego domu to się zwalniają i już. Mają już dość jakiś stuków, niszczenia im materiałów budowlanych, chowania narzędzi, wywalania stołu na którym jedli. Nadstawiałem ucho....nadstawiałem....a potem zapytałem:<br>-Ale panowie, co tam się dzieje? jeden z budowlańców machnął ręką i odszedł, drugi milczał a trzeci powiedział:<br>-Panie, tam diabeł mieszka!<br>-A gdzie to jest? Spytałem.<br>-A tu niedaleko w Budoradzu. Pod numerem 7, jak już koniec wioski to ostatnia chałupa po prawej.<br>Nie przepuszczam takich okazji. Pojechałem. Znalazłem. Chodzę po parterze, mijam wejście do piwnicy. Okna porozbijane, farba ze ścian schodzi. Cuchnie jak na cmentarzu. Wchodzę po schodach na strych, robię zdjęcia...i nagle: Łup! dostałem czymś twardym w tył głowy. Nie, nic nie spadło mi na głowę, dostałem w tył, tak jakby ktoś czymś rzucił. To \"coś\" z brzękiem spadło na drewniane schody. Podnoszę, oglądam...a to jakiś stary dziesięciocentymetrowy gwóźdź, kuty, czworokątny...<br>No tak, jakiemuś \"bytowi\" nie podoba się że tam byłem. Warto zajrzeć i do piwnicy. Ale byłem sam, więc nie ryzykuję. Może kolejnym razem?<br><br>https://www.facebook.com/groups/821010141730226/posts/1271684273329475/"));
