wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [51.6724213, 15.9833518], "opuszczona wieś Żukowice", "https://www.facebook.com/100050568816130/posts/1075173374178280/?rdid=bfa5dEm1JAeaTK7U<br><br>szary burek post<br><br>Tak jak zapowiadałem publikuję pełną fotorelację z wysiedlonej wsi Żukowice. Miejscowość położona jest na terenie gminy o tej samej nazwie, ulokowanej w powiecie głogowskim w woj. dolnośląskim. Kiedyś była największą wsią w gminie, mieszkało tu prawie 1200 osób. Tuż po II wojnie światowej znajdował się tu bank, kino, księgarnia, ośrodek zdrowia, szkoła podstawowa, a także wiele różnych punktów usługowych.<br>Wieś zaczęła pustoszeć, gdy tuż za nią w latach 70. wybudowana została Huta Miedzi Głogów. Z czasem mieszkańcy sami zaczęli opuszczać swoje domy, później zapadła decyzja o wysiedleniu. Żukowice znalazły się w obszarze ochronnym, związanym z wyższym zanieczyszczeniem środowiska. Mieszkańcy dostali odszkodowania i wyprowadzili się do pobliskiego Głogowa, lub innych pobliskich miejscowości. Do 1995 r. wieś została praktycznie całkowicie wysiedlona.<br>Wiele domów znajdujących się w tej wsi zostało już wyburzonych. Nadal jeszcze stoją tu puste domy i gospodarstwa, które latem mocno porastają bujną roślinnością. Choć wieś momentami wygląda na opuszczoną, nadal działają tu jeszcze niektóre gospodarstwa i instytucje. <br><br>Pełna fotorelacja z tego miejsca, znajduje się tradycyjnie na moim blogu. Link znajdziecie w komentarzach.<br>Znajduje się tam o wiele więcej zdjęć niż opublikowałem tutaj na Fanpage. Zobaczcie jak ta miejscowość wygląda dzisiaj."));
