wszystkiePinezki.push(dodajPinezke("Opuszczone Polska", [53.2891625, 20.9129531], "Zamko kościólek do spr", "https://m.olx.pl/d/oferta/kosciolek-przestrzen-hotelowa-i-gastronomiczna-dzialka-3500-m2-CID3-ID12B5Jx.html?fbclid=IwZXh0bgNhZW0CMTEAAR2tNzyVBRk70LQgpEZewbRAGJquml2OI-5b5BnWaMrkHXerYfc5bW_fwUE_aem_QlFvkqx8Cw18voLSTC4mOg        w okolicy też 2 stare cmentarze.      Atrakcyjna nieruchomość pod inwestycję w miejscowości Opaleniec k/Chorzel przy trasie DK57 Warszawa -Mazury. Działka o powierzchni 3500 m2 zabudowana z dawnym, neogotyckim kościołem Ewangelicko-Augsburskim wybudowanym w 1878 r. oraz dobudowanymi budynkami nawiązującymi do gotyckiej architektury (trzy kondygnacje: łącznie ponad 800 m2 pow. użytkowej). Kościół i zabudowania pokryte dachówką (stan bardzo dobry). Zabudowania połączone są: wspólnym dziedzińcem, długim tarasem, wieżami i attyką w formie murku z balustradą. Nieruchomość częściowo ogrodzona posiada dwie bramy oraz jest otoczona krzewami i drzewami. Nieruchomości posiada bezpośredni zjazd z drogi krajowej. Media – prąd, woda. Kanalizacja w trakcie realizacji. Nieruchomość posiada pozwolenie na użytkowanie.<br>Idealny obiekt: kościół – wnętrze wys. ok.9-10 m wraz z przylegającymi budynkami tworzą nietuzinkowy Zameczek. Konieczność remontu daje jednocześnie nieograniczone możliwości przekształcenia go np. w wyjątkową rezydencję, wielopoziomowe centrum kulturalno – wystawiennicze, SPA czy też w miejsce hotelowo-gastronomiczne.W okolicy dostępne są wyjątkowe tereny leśne w tym ścieżki rowerowe, szlaki, pomniki przyrody.<br>Agencjom nieruchomości bardzo dziękujemy.Sprzedaż tylko i wyłącznie bezpośrednia – kupujący nie ponosi opłat prowizyjnych."));
